import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Sidebar from './components/Sidebar';
import { ProtectedRoute } from './components/ProtectedRoute';
import Home from './pages/Home';
import Telemedicine from './pages/Telemedicine';
import EmergencyCare from './pages/EmergencyCare';
import Pharmacy from './pages/Pharmacy';
import SymptomChecker from './pages/SymptomChecker';
import HealthRecords from './pages/HealthRecords';
import DoctorFinder from './pages/DoctorFinder';
import AppointmentBooking from './pages/AppointmentBooking';
import InsuranceSupport from './pages/InsuranceSupport';
import Login from './pages/Login';
import Profile from './pages/Profile';
import PrescriptionOCR from './pages/PrescriptionOCR';

import { Navigate } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="min-h-screen flex flex-col">
        <Navbar />
        <div className="flex">
          <Sidebar />
          <main className="flex-grow pt-2 md:pt-3 px-3 md:px-5 lg:px-6">
            <div className="w-full max-w-6xl xl:max-w-7xl mx-auto">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/telemedicine" element={<ProtectedRoute><Telemedicine /></ProtectedRoute>} />
            <Route path="/emergency-care" element={<ProtectedRoute><EmergencyCare /></ProtectedRoute>} />
            <Route path="/pharmacy" element={<ProtectedRoute><Pharmacy /></ProtectedRoute>} />
            <Route path="/symptom-checker" element={<ProtectedRoute><SymptomChecker /></ProtectedRoute>} />
            <Route path="/login" element={<Login />} />
            <Route 
              path="/health-records" 
              element={
                <ProtectedRoute>
                  <HealthRecords />
                </ProtectedRoute>
              } 
            />
            <Route path="/doctor-finder" element={<ProtectedRoute><DoctorFinder /></ProtectedRoute>} />
            <Route path="/appointment-booking" element={<ProtectedRoute><AppointmentBooking /></ProtectedRoute>} />
            <Route path="/insurance-support" element={<ProtectedRoute><InsuranceSupport /></ProtectedRoute>} />
            <Route path="/profile" element={<ProtectedRoute><Profile /></ProtectedRoute>} />
            <Route path="/prescription-ocr" element={<ProtectedRoute><PrescriptionOCR /></ProtectedRoute>} />
            <Route path="/voice-control" element={<ProtectedRoute><VoiceControl /></ProtectedRoute>} />
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
            </div>
          </main>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
